import React from 'react';
import "./Popup.css"
const Popup = ({ onClose }) => {
  return (
    <div className="popup-container">
      <div className="popup-content">
        <h2>Required Documents List</h2>
        <p>List of documents needed for setup:</p>
        <ul>
          <li>Document 1</li>
          <li>Document 2</li>
          <li>Document 3</li>
        </ul>
        <button style={{width:"150px"}}  className="mt-8 bg-red-500 text-white py-2 px-4 rounded">Continue</button>

      </div>
    </div>
  );
};

export default Popup;
